# WaterCloset Core Config  #
Core:
  Plugins:
  - WASpleef
  - WAAlliances
  - VTExtension
  - WC
  - StaticField
  - TNTNerf
  Help:
  - '&dWaterCloset &5// &dHelp Core'
  - '&f--- --- --- --- --- --- ---'
  - '&1| &3/spleef help &f// &3Spleef Menu'
  - '&1| &3/waa help &f// &3Alliance Menu'
  - '&1| &3/wc reload &f// &3WaterCloset Reload Menu'
  - '&1| &3/wc placeholders &f// &3Chat PlaceHolder Menu'
  - '&1| &3/wc chat &f// &3Avalible Chat Channels / Messaging'
  - '&1| &3/wc paragons &f// &3Paragon Commands'
  - '&1| &3/wc session &f// &3Minecraft Server Status'
  - '&1| &3/wc rainoff &f// &3Turn off rain (EMPEROR+)'
  
  JoinMessages:
  - So it seems that %p has logged in!
  - Glad to see you, %p!
  - Welcome to WA, %p!
  - Look out! Here comes %p!
  - Well well well... look who it is! (%p)
  - '%p has joined Worlds Apart!'
  - '%p has logged in over 9000 times! (Give or take)'
  - Hello %p, may I take your hat?
  - '%p is liak so totes online, obvi.'
  - '%p is too cool for anything other than Minecraft.'
  - '%p has joined us today. YAY!'
  - How are you today, %p?
  - '%p decided to drop in on us today.'
  - '%p has returned from the outside world...'
  - A wild %p has appeared!
  - So %p, I heard you like WA...
  - '%p has virtualized into Worlds Apart!'
  - Hi there %p!
  - '%p is cray-cray enough to join us today.'
  - '%p is in a much better place now.'
  - '%p has joined WA. Please stare at them for awhile.'
  - '%p logged in just for you.'
  - '%p is overjoyed to join us today. Really.'
  - '%p has fallen from heaven and landed in WA.'
  - '%p is the cats meow for joining WA.'
  - '%p is the bees knees for joining WA.'
  - How do you do, %p?
  - '%p is liak oh so totes awes for logging in.'
  - Hello there %p...you are not going to leave us.. right?
  - '%p has risen from the grave to play with us today.'
  - Speaking of %p... here they are!
  - Hello %p. We are watching you. Always.
  - Is it getting hot in here, or is it just %p?
  - 'MASHED POTATOES! (%p)'
  QuitMessages:
  - So it seems that %p has logged out!
  - Interesting, it seems that %p has left!
  - Cya later, %p!
  - Look out! %p is leaving!
  - Well well well... look who left! (%p)
  - '%p has left Worlds Apart!'
  - '%p has logged out over 9000 times! (Give or take)'
  - Bye %p, here is your hat back.
  - '%p is liak so totes offline, obvi.'
  - '%p is too cool for Minecraft.'
  - '%p has left us today. BOO!'
  - Bye bye for now, %p!
  - '%p decided to drop out on us today.'
  - '%p has entered the outside world...'
  - A wild %p has disappeared!
  - So %p, I heard you like to leave WA...
  - '%p has de-virtualized out of Worlds Apart!'
  - Bye %p!
  - '%p is cray-cray enough to leave us today.'
  - '%p is in a much worse place now, unless they went to IC.'
  - '%p has left WA. Please stare at them for awhile.'
  - '%p logged out just for you.'
  - '%p is overjoyed to leave us today. How rude!.'
  - '%p has bailed!'
  - '%p is not the cats meow for leaving WA.'
  - '%p is not the bees knees for leaving WA.'
  - Peace out, brussel sprouts! ~%p
  - '%p is liak oh so not totes awes for logging out.'
  - But %p! You said you would never leave! YOU PROMISED!
  - '%p has fallen back into the grave.'
  - Speaking of %p... oh, they left. Darn.
  - Goodbye %p. We are still watching you. Always.
  - Another one bites the dust. (%p)
  DeathMessages:
    DEFAULT:
    - '%p died. Why? I don''t know or care. They''re dead. DEAD.'
    BLOCK_EXPLOSION:
    - '%p exploded. Like that block of TNT they were standing on.'
    FALL:
    - 'Turns out that %p can''t actually fly. Looks like that hurt.'
    DROWNING:
    - '%p thought they were a fish. Now they''re dead.'
    ENTITY_ATTACK:
      # These are really bad... so please change them if you want. ;_; #
      DEFAULT:
      - '%p took on one too many mobs, who used THUNDER SMASH!'
      PLAYER:
      - '%p took on one too many %a''s, who used %i.'
      ARROW:
      - '%p was stupid enough to get killed from an %a already on the GROUND.'
      BAT:
      - '%p apparently was too mean to a %a, which sucked the living life out of them.'
      BLAZE:
      - '%p took on one too many %a. I guess they think they are immune to fire or something.'
      BOAT:
      - 'A %a just killed %p. Yup. That just happened.'
      CAVE_SPIDER:
      - '%p apparently loves poison. Because %as are just attracted to them.'
      COMPLEX_PART:
      - 'Wait. What''s a(n) %a? I''m confused. But apparently %p just died from it. Oh well.'
      COW:
      - '%p gutted too many %as. Now they died from a %a stampede.'
      CREEPER:
      # You can feel free to change this... #
      - '%p c***-punted too many %as.'
      DROPPED_ITEM:
      - 'Too bad this death message wont ever pop up. Unless %p found a way to die by %as.'
      EGG:
      - 'Too many chicken babies killed %p. All that protein was too much for them.'
      ENDER_CRYSTAL:
      - '%p attempted to destroy an %a. Well, apparently they didn''t know that those things blow up...'
      ENDER_DRAGON:
      - '%p tried to piggy-back an %a. %as fly you know.'
      ENDER_PEARL:
      - 'Someone shot an %a at %p as a weapon! And they succedded!'
      ENDER_SIGNAL:
      - 'Silly, %p. You can''t die from %as. Oh wait...'
      ENDERMAN:
      - '%p took on one too many %a. Those dark eyes stared into %p''s soul too hard...'
      EXPERIENCE_ORB:
      - 'I don''t even. %p died from an %a. Wat.'
      FALLING_BLOCK:
      - 'The sky is falling! The sk- wait, nope, was just a falling block. Poor %p.'
      FIREBALL:
      - 'A %a was shot at %p. Can this death message get any more boring?'
      FIREWORK:
      - '%p loves %as so much that they gave their life just to view them. ''Merica.'
      FISHING_HOOK:
      - '%p got hooked in the eye by a %a. Yeah... I didn''t want to imagine that either.'
      GHAST:
      - '%as deal melee damage? Since when?! ( %p )'
      GIANT:
      - '%p disturbed a %a from its sleep. As you can see, things did not turn out that well.'
      HORSE:
      - '%p got trampled by a %a. Ouch.'
      IRON_GOLEM:
      - '%p disturbed an %a''s village. They now know the consequences.'
      ITEM_FRAME:
      - '%p is so ticklish that they died from leather on an %a.'
      LIGHTNING:
      - 'So, %p''s %a rod works. REALLY well.'
      MAGMA_CUBE:
      # I did my best. ;_; #
      - 'The cubes from the nether are attacking! ( %p )'
      MINECART:
      - '%p was impailed by a %a going over 9000 mph.'
      MINECART_CHEST:
      - '%p was impailed by a %a going over 9000 mph.'
      MINECART_FURNACE:
      - '%p was impailed by a %a going over 9000 mph.'
      MINECART_HOPPER:
      - '%p was impailed by a %a going over 9000 mph.'
      MINECART_MOB_SPAWNER:
      - '%p was impailed by a %a going over 9000 mph.'
      MINECART_TNT:
      - '%p was impailed by a %a going over 9000 mph.'
      MUSHROOM_COW:
      - '%p found a mushroom island. Its inhabitants were not very welcome.'
      OCELOT:
      - 'MeeeeeeeeeeeOOOWWWWWWWWW! ( %p )'
      PAINTING:
      - '%p is so ticklish that they died from leather on an %a.'
      PIG:
      - '%p died from rolling in the mud with too many %as.'
      PIG_ZOMBIE:
      - '%as hurt you know. ( %p )'
      PRIMED_TNT:
      - '%p was kersploded from some %a. I guess that''s what happen when you mess with explosives.'
      SHEEP:
      - 'BaaaAAAAAaaaaaAAAAAaa. ( %p )'
      SILVERFISH:
      - 'Some %a ate %p''s feet until there was nothing left.'
      SKELETON:
      - '%p found a %a that didn''t have a bow. Well, you can see the rest.'
      SMALL_FIREBALL:
      - 'A %a was shot at %p. Can this death message get any more boring?'
      SNOWBALL:
      - '%as aren''t supposed to dead damage! Oh wait... ( %p )'
      SNOWMAN:
      - 'A %a turned against %p. How sad.'
      SPIDER:
      - '%p watched too much Lord of The Rings. Arachnids are not to be messed with.'
      SPLASH_POTION:
      - 'This death message shouldn''t appear. Like ever. ( %p )'
      SQUID:
      - '%a are friendly creatures... right? ... ( %p )'
      THROWN_EXP_BOTTLE:
      - '%a tried to take too much crack. ( %p )'
      UNKNOWN:
      - 'This shouldn''t exist. So why did %p die from it.'
      VILLAGER:
      - '%p gave a %a a very bad trade. Very bad indeed.'
      WEATHER:
      - 'The gods were not pleased of %p''s performance.'
      WITCH:
      - 'You are not supposed to bargain with %aes! ( %p )'
      WITHER_SKULL:
      - '%p tried summoning a wither. But it was too much...'
      WOLF:
      - 'Balto got very angry at %p.'
      ZOMBIE:
      - 'A %a horde came out of the screen from Walking Dead. What a shame. ( %p )'
    FALLING_BLOCK:
    - 'The sky is falling! The sk- wait, nope, was just a falling block. Poor %p.'
    FIRE:
    - '%p is on fire! Kidding, they''re dead.'
    FIRE_TICK:
    - '%p is on fire! Kidding, they''re dead.'
    LAVA:
    - 'Jump in the java, they said. It''ll be fine, they said. ( %p )'
    LIGHTNING:
    - 'So, %p''s lightning rod works. REALLY well.'
    MAGIC:
    - 'Majyyk and sorcery. ( %p )'
    MELTING:
    - 'Melting is a death event? ( %p )'
    PROJECTILE:
    - '%p was impailed by an arrow and didn''t survive. Luckily, their knee is intact. Like that matters.'
    SUFFOCATION:
    - '%p suffocated in a long, drawn-out process that was very painful.'
    SUICIDE:
    - '%p wasted tons of cash on those suicide-prevention meetings.'
    WITHER:
    - '%p withered away. Get it? Withered? HAHAHA.. ha.. haa... a... just /suicide.'
    VOID:
    - '%p fell out of the world. That''s a thing.'
    CONTACT:
    - '%p just wanted to give that cactus a big ol'' hug!'
